-- title:  ship
-- author: beans
-- desc:   lernin
-- script: lua

e=0
t=0
x=96
y=24
s=1
mis_speed=1
mis={}
score=0
enemy={}
enemy_speed=1

function enemy_create(rand_x)
	table.insert(enemy,{x=rand_x,y=-30})
end

function enemy_update()
	for i, v in ipairs(enemy)do
		v.y=v.y+enemy_speed
		spr(4,v.x,v.y,0)
		if v.y > 100 then
			table.remove(enemy,i)
		end
	end
end

function mis_shoot(start_x,start_y)
	table.insert(mis,{x=start_x,y=start_y})
end

function mis_update()
	for i, v in ipairs(mis)do
		v.y=v.y-mis_speed
		spr(3,v.x,v.y,0)
		if v.y < 20 then
			table.remove(mis,i)
		end
	end
end

function TIC()

	if btn(0) then y=y-1 end
	if btn(1) then y=y+1 end
	if btn(2) then x=x-1 end
	if btn(3) then x=x+1 end
 if btnp(7) then mis_shoot(x,y) end
 

	cls(13)
	if t==5 then
		s=s+1
		if s>2 then s=1 end
		t=0
 end
 if e==60 then
 	local spawn = math.random(8,240-16)
 	enemy_create(spawn)
  e=0
 end
  mis_update()
		enemy_update()
	spr(s,x,y,0)
	print("score!",0,0)
	t=t+1
	e=e+1
end

